import React from 'react';
import { Card, CardBody, Row, Col, CardImg, CardTitle } from 'reactstrap';

const Listing = props => {
    const name = props.info['Name'].replace('-COMMA-', ',')
    const location = props.info['RoomType'] + ' in ' + props.info['Neighborhood']

    return (
        <>
            <Row>
                <Col md={{size: 10, offset: 1}}>
                    <Card>
                        <Row>
                            <Col className="listing-pic" xs='4'md='2' align='center'>
                                <CardImg className="card-img" top src={props.info['PictureURL']} alt="airbnb listing picture" />
                            </Col>
                        </Row>
                        <CardBody>
                            <CardTitle tag='h5'>{name}</CardTitle>
                        </CardBody>
                    </Card>
                </Col>
            </Row>
        </>
    )

}

export default Listing;
